import React from "react";
import { Link } from "react-router-dom";
import fetchUserData from "./../../helpers"

const Header = () => {
    let user = fetchUserData();

    return (
        <>
            <header className="bg-blue-900 fixed top-0 left-0 w-full">
                <nav className="mx-auto flex max-w-7xl items-center justify-between p-6 lg:px-8" aria-label="Global">
                    <div className="flex lg:flex-1">
                        <Link to="/" className="-m-1.5 p-1.5">
                            <span className="doto text-2xl font-semibold text-slate-50">Koozie</span>
                        </Link>
                    </div>

                    <form className="w-2/5">
                        <label htmlFor="default-search" className="mb-2 text-sm font-medium text-slate-50 sr-only">Search</label>

                        <div className="relative">

                            <div className="absolute inset-y-0 start-0 flex items-center ps-3 pointer-events-none">
                                <svg className="w-4 h-4 text-slate-50" aria-hidden="true" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 20 20">
                                    <path stroke="currentColor" strokeLinecap="round" stroke-linejoin="round" strokeWidth="2" d="m19 19-4-4m0-7A7 7 0 1 1 1 8a7 7 0 0 1 14 0Z" />
                                </svg>
                            </div>

                            <input type="search" id="default-search" className="block w-full px-4 py-3 ps-10 text-sm text-slate-50 rounded-lg bg-blue-950 focus:ring-blue-500 focus:border-blue-500" placeholder="Search circles" />
                        </div>
                    </form>

                    {user ? <div className="hidden lg:flex lg:flex-1 lg:justify-end">
                        <Link to="/sign-out" className="text-sm/6 font-semibold text-slate-50">Sign out</Link>
                    </div> : <div className="hidden lg:flex lg:flex-1 lg:justify-end">
                        <Link to="/sign-in" className="text-sm/6 font-semibold text-slate-50">Sign in <span aria-hidden="true">&rarr;</span></Link>
                    </div>}
                </nav>
            </header>
        </>
    );

};

export default Header;
